    [],nt"num_tags": 3,nt"name": "forest-habitat-management-plan-for-okefenokee-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of this plan is to provide
    guidelines which will strive to make the best use of available management techniques
    to provide suitable habitat for native wildlife species.  The  plan stresses maximizing
    habitat diversity with special emphasis placed on those habitat types which support
    endangered species.  The intent is that these guidelines should be flexible enough
    to accomodate unforeseen emergencies, newly discovered habitat needs, and to take
    advantage of new management techniques and research developments.  The plan also
    takes into account other uses such as wildlife observation, sightseeing, research,
    and environmental eductation.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
